import React from "react";
import {Route,Routes} from "react-router-dom";
import InputTask from "./components/InputTask";
function App() {
  return (
   <>
  <Routes>
    <Route path="/InputTask" element ={<InputTask />}/>
  </Routes>
   </>
  );
}

export default App;
